import logo from "./logo.svg"

const companyName = 'ReactFacts';
let item1 = 'Tutorial';
let item2 = 'Docs';
let item3 = 'Blog';
let item4 = 'Community';
let item5 = 'About';

const Header = () => {
  return(
  <header> 
    <ul className="navbar">
      <div className="logo-and-name">
      <img src={logo} className="logo-size" alt="Didn't work!"></img>
      <h2 className="company-name">{companyName}</h2>
      </div>
      <ul className="navbar-list">
        <li className="navbar-list-item"><a href="https://reactjs.org/tutorial/tutorial.html">{item1}</a></li>
        <li className="navbar-list-item"><a href="https://reactjs.org/docs/getting-started.html">{item2}</a></li>
        <li className="navbar-list-item"><a href="https://reactjs.org/blog/2022/03/08/react-18-upgrade-guide.html">{item3}</a></li>
        <li className="navbar-list-item"><a href="https://reactjs.org/community/support.html">{item4}</a></li>
        <li className="navbar-list-item"><a href="">{item5}</a></li>
      </ul>
    </ul>
  </header>
  )
};

export default Header
